import React, { useState } from "react";
import table from "../dashboard/component/data/tabledata.json";
import "./DataSearch.css";

const DataSearch = () => {
  const [searchdata, setSearchData] = useState("");

  return (
    <div>
      <div className="data-search">
        <div className="data-search__input">
          <input
            type="text"
            placeholder="Search Data by ICAO.........."
            onChange={(event) => {
              setSearchData(event.target.value);
            }}
          />
           </div>
          {/* <button><i class="bi bi-search"></i></button> */}

          {table.filter((val)=>{
            if (searchdata == ""){
              return val
            } else if (val.icao24.toLowerCase().includes(searchdata.toLowerCase())){
              return val
            }
          }).map((val, key) => {
            return (
              <div className="data-show" key={key}>
              <ul>
                <li>ID: {val.id}</li>
                <li>ICAO: {val.icao24}</li>
                <li>ICAO: {val.registration}</li>
                <li>ID: {val.manufacturericao}</li>
                <li>ID: {val.manufacturername}</li>
                <li>ID: {val.model}</li>
                <li>ID: {val.typecode}</li>
                <li>ID: {val.serialnumber}</li>
                <li>ID: {val.linenumber}</li>
                <li>ID: {val.icaoaircrafttype}</li>
                <li>ID: {val.operator}</li>
                <li>ID: {val.operatorcallsign}</li>
                <li>ID: {val.operatoricao}</li>
                <li>ID: {val.operatoriata}</li>
                <li>ID: {val.owner}</li>
                <li>ID: {val.testreg}</li>
                <li>ID: {val.registered}</li>
                <li>ID: {val.reguntil}</li>
                <li>ID: {val.built}</li>
                <li>First Flight Date: {val.firstflightdate}</li>
                <li>Seat Configuration: {val.seatconfiguration}</li>
                <li>Engines: {val.engines}</li>
                <li>modes: {val.modes}</li>
                <li>adsb: {val.adsb}</li>
                <li>acars: {val.acars}</li>
                <li>notes: {val.notes}</li>
                <li>categorydescription: {val.categorydescription}</li>
                <li>status: {val.status}</li>
                <li>matched: {val.matched}</li>
              </ul>
              </div>
            );
          })}

      </div>
    </div>
  );
};

export default DataSearch;
